        <style>
            body {
                margin: 0; padding: 0;
                background: linear-gradient(135deg, #100f20 0%, #080518 100%); 
                font-family: 'Inter', sans-serif;
                min-height: 100vh;
            } 
            .container { 
                max-width: 1000px; margin: 0 auto; padding: 20px; text-align: left;
            } 
            .grid {
                display: grid;
                grid-template-columns: 1fr; 
                gap: 24px; 
            }
            @media(min-width: 600px){
                .grid { grid-template-columns: 1fr 1fr; }
                .col-span-2-centered {
                    grid-column: 1 / span 2; 
                    justify-self: center; 
                    max-width: 480px; 
                }
            }
            .card {
                background: #1F2937; border-radius: 16px; box-shadow: 0 6px 20px rgba(0,0,0,0.5); 
                overflow: hidden;
                transition: transform 0.4s cubic-bezier(0.25, 0.46, 0.45, 0.94), box-shadow 0.4s ease;
                border: 2px solid #3730a300; animation: fadein 0.8s ease; opacity: 0; animation-fill-mode: forwards; 
            }
            .card:hover {
                transform: translateY(-8px) scale(1.01); 
                box-shadow: 0 12px 25px rgba(0, 0, 0, 0.5), 0 0 40px rgba(100, 116, 139, 0.4); 
                border: 2px solid #6366f1aa; 
            }
            .card img { width: 100%; height: auto; display: block; }
            .card a { text-decoration: none; display: block; }
            @keyframes fadein {
                from { opacity: 0; transform: translateY(30px) scale(0.95); }
                to { opacity: 1; transform: translateY(0) scale(1); }
            }
            .cta {
                display: block; width: fit-content; margin: 40px auto 30px auto; 
                background: #6366F1; color: #fff; padding: 14px 32px;
                border-radius: 9999px; text-decoration: none; font-weight: bold;
                text-align: center; letter-spacing: 1px;
                box-shadow: 0 8px 20px rgba(99, 102, 241, 0.4); 
            }
            .cta:hover { background: #4F46E5; transform: scale(1.05); box-shadow: 0 10px 25px rgba(99, 102, 241, 0.6); }
            h1 {
                color: #E5E7EB; margin-top: 0; margin-bottom: 30px; font-weight: 800; font-size: 2.5rem; text-align: center;
            }
            p.footer-text {
                color: #9CA3AF; margin-top: 20px; font-size: 14px; text-align: center;
            }
            .highlight { color: #818CF8; }
        </style>
